			key[i] |= (key[i-1] & 0x00F0) ^ (((key[i] & 0x0F00) >> 4) & 0x00F0); //pf("%04X ", key[i]);
			key[i] |= (key[i-1] & 0x000F) ^ (((key[i] & 0x00F0) >> 4) & 0x000F); //pf("%04X ", key[i]);
